import React, { useEffect } from 'react';

const ChatSupport = () => {
  useEffect(() => {
    const s = document.createElement('script');
    s.async = true;
    s.src = 'https://embed.tawk.to/SCRIPT_KEY';
    s.charset = 'UTF-8';
    s.setAttribute('crossorigin', '*');
    document.head.appendChild(s);

    return () => {
      // Hủy chat support khi component bị hủy
      const tawkScript = document.querySelector('script[src="https://embed.tawk.to/SCRIPT_KEY"]');
      if (tawkScript) {
        document.head.removeChild(tawkScript);
      }
    };
  }, []);

  return null; // Không có giao diện hiển thị
};

const Chatpage = () => {
  return (
    <div>
      <h1>Trang Chat</h1>
      {/* ... */}
      <ChatSupport />
    </div>
  );
};

export default Chatpage;
